import React from "react";

const MessageForm = () => {
    return (
        <div>
            <form className="message_form">
                <div>
                    <input type="text" placeholder="Enter message" />
                </div>
                <div>
                    <button className="btn"></button>
                </div>
            </form>
        </div>
    )
}

export default MessageForm;
